import { Col, Row } from "antd";
import React from "react";

function IdariNobet() {
  return (
    <div>
      <Row>
        <Col span={24}>
          <span>İDARİ BÜRO NÖBET LİSTESİ</span>
        </Col>
      </Row>
    </div>
  );
}

export default IdariNobet;
